from pwn import *

output = ""
n = 0

def hex_to_16byte_blocks(hex_string):
    # Ensure the string has even length (each byte = 2 hex chars)
    if len(hex_string) % 2 != 0:
        raise ValueError("Hex string must have an even number of characters")
    
    # Split the hex string into 16-byte blocks (32 hex chars each)
    block_size = 32  # 16 bytes = 32 hex characters
    blocks = [hex_string[i:i+block_size] for i in range(0, len(hex_string), block_size)]
    
    return blocks

blocks = hex_to_16byte_blocks(output)

with open("CryptoHack\AES\BeanCounter\\Flag.png","wb") as fil:
    res =b""
    for block in blocks:
        if n == 0:

            key = xor(bytes.fromhex(block),bytes.fromhex("89504E470D0A1A0A0000000D49484452"))
            res += (xor(bytes.fromhex(block),key))
            n = 1
        else:
            res += (xor(bytes.fromhex(block),key))
    fil.write(res)